import React, { useState, useEffect } from 'react';
import axios from 'axios';

function EmployeeProfile() {
  const [profile, setProfile] = useState(null);
  const [isEditing, setIsEditing] = useState(false);
  const [formData, setFormData] = useState({
    employeeId: '',
    dateOfBirth: '',
    dateOfJoining: '',
    department: '',
    position: ''
  });
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetchProfile();
  }, []);

  const fetchProfile = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5000/api/employee/profile', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setProfile(response.data);
      setFormData({
        employeeId: response.data.employeeId,
        dateOfBirth: response.data.dateOfBirth?.split('T')[0] || '',
        dateOfJoining: response.data.dateOfJoining?.split('T')[0] || '',
        department: response.data.department || '',
        position: response.data.position || ''
      });
    } catch (error) {
      if (error.response?.status === 404) {
        setIsEditing(true); // Show form to create profile
      }
    }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      const url = profile 
        ? 'http://localhost:5000/api/employee/profile'
        : 'http://localhost:5000/api/employee/profile';

      const method = profile ? 'put' : 'post';

      const response = await axios[method](url, formData, {
        headers: { Authorization: `Bearer ${token}` }
      });

      setProfile(response.data.employee);
      setIsEditing(false);
      setMessage(response.data.message);
    } catch (error) {
      setMessage(error.response?.data?.message || 'Operation failed');
    }
  };

  if (isEditing || !profile) {
    return (
      <div className="bg-white shadow rounded-lg p-6">
        <h2 className="text-2xl font-bold text-gray-900 mb-6">{profile ? 'Edit Profile' : 'Create Profile'}</h2>
        <form onSubmit={handleSubmit} className="max-w-lg space-y-6">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">Employee ID:</label>
            <input
              type="text"
              name="employeeId"
              value={formData.employeeId}
              onChange={handleChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
              required
              disabled={profile} // Can't change ID after creation
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">Date of Birth:</label>
            <input
              type="date"
              name="dateOfBirth"
              value={formData.dateOfBirth}
              onChange={handleChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
              required
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">Date of Joining:</label>
            <input
              type="date"
              name="dateOfJoining"
              value={formData.dateOfJoining}
              onChange={handleChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
              required
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">Department:</label>
            <input
              type="text"
              name="department"
              value={formData.department}
              onChange={handleChange}
              placeholder="e.g., IT, HR, Finance"
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">Position:</label>
            <input
              type="text"
              name="position"
              value={formData.position}
              onChange={handleChange}
              placeholder="e.g., Software Developer, Manager"
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
            />
          </div>

          <div className="flex space-x-4">
            <button type="submit" className="bg-blue-600 text-white px-6 py-2 rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 transition-colors">
              {profile ? 'Update Profile' : 'Create Profile'}
            </button>
            {profile && (
              <button type="button" onClick={() => setIsEditing(false)} className="bg-gray-600 text-white px-6 py-2 rounded-md hover:bg-gray-700 focus:outline-none focus:ring-2 focus:ring-gray-500 focus:ring-offset-2 transition-colors">
                Cancel
              </button>
            )}
          </div>
        </form>
        {message && <div className="mt-4 p-3 bg-green-100 text-green-700 rounded-md">{message}</div>}
      </div>
    );
  }

  return (
    <div className="bg-white shadow rounded-lg p-6">
      <div className="flex justify-between items-center mb-6">
        <h2 className="text-2xl font-bold text-gray-900">My Profile</h2>
        <button onClick={() => setIsEditing(true)} className="bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 transition-colors">
          Edit Profile
        </button>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <div>
          <label className="block text-sm font-medium text-gray-500">Employee ID:</label>
          <span className="text-lg text-gray-900">{profile.employeeId}</span>
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-500">Name:</label>
          <span className="text-lg text-gray-900">{profile.name}</span>
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-500">Email:</label>
          <span className="text-lg text-gray-900">{profile.email}</span>
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-500">Date of Birth:</label>
          <span className="text-lg text-gray-900">{new Date(profile.dateOfBirth).toLocaleDateString()}</span>
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-500">Date of Joining:</label>
          <span className="text-lg text-gray-900">{new Date(profile.dateOfJoining).toLocaleDateString()}</span>
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-500">Department:</label>
          <span className="text-lg text-gray-900">{profile.department || 'Not specified'}</span>
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-500">Position:</label>
          <span className="text-lg text-gray-900">{profile.position || 'Not specified'}</span>
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-500">Available Leaves:</label>
          <span className="text-lg text-gray-900">{profile.availableLeaves} days</span>
        </div>
      </div>

      {message && <div className="mt-6 p-3 bg-green-100 text-green-700 rounded-md">{message}</div>}
    </div>
  );
}

export default EmployeeProfile;
